import React, { useRef, useState } from "react";
import { Button, ButtonToolbar } from "react-bootstrap";
import { Tooltip, OverlayTrigger, Overlay } from "react-bootstrap";
import { Popover } from "react-bootstrap";

import "./Architecture.css";

export default function Architecture() {

  const [show, setShow] = useState(false);
  const [target, setTarget] = useState(null);
  const ref = useRef(null);

  function handleClick(event) {
    setShow(!show);
    setTarget(event.target);
    console.log("Ref: ", ref.current);
    console.log("Target: ", event.target);

  }


  return (
    <body>
    <div  >
      <img class="image" src={require("./architecture3.png")}
            alt="App architecture" 
            height="562"
            weight="644"
            usemap="#image-map">
      </img>
      <map  name="image-map">
      <area target="_self"  id="popover1" alt="1" title="1" onClick={handleClick} coords="133,58,20" shape="circle" />
      <area target="_self" id="popover2" alt="2" title="2" onClick={handleClick} href="#" coords="247,198.5,20" shape="circle" />
      </map>  

    </div>
    <div>

      <Overlay
        show={show}
        target={target}
        placement="right"
        container={ref.current}
        containerPadding={20}
      >
        <Popover id="popover1" title="Popover bottom" >
          <strong>Holy guacamole!</strong>
        </Popover>
      </Overlay>
    </div>
    </body>
  );
}


